

CREATE DATABASE IF NOT EXISTS `YTTERBIUM HIGH`;
USE `YTTERBIUM HIGH`;



DROP TABLE IF EXISTS `DEPARTMENTS`;

CREATE TABLE `DEPARTMENTS` (
  `DEPARTMENT ID` VARCHAR(255) NOT NULL, 
  `DEPARTMENT NAME` VARCHAR(255) NOT NULL, 
  PRIMARY KEY (`DEPARTMENT NAME`)
) ENGINE=myisam DEFAULT CHARSET=utf8;

SET autocommit=1;

