CREATE TABLE `DORMITORY TABLE` (
  `DORM NAME` VARCHAR(255) NOT NULL, 
  PRIMARY KEY (`DORM NAME`)
) ENGINE=myisam DEFAULT CHARSET=utf8;

SET autocommit=1;


