DROP TABLE IF EXISTS `FEES PAYMENT`;

CREATE TABLE `FEES PAYMENT` (
  `STUDENT ID` INTEGER NOT NULL DEFAULT 0, 
  `STUDENT'S NAME` VARCHAR(255), 
  `FORM` VARCHAR(255), 
  `DATE OF PAYMENT` VARCHAR(255), 
  `AMOUNT PAID` INTEGER DEFAULT 0, 
  INDEX (`AMOUNT PAID`), 
  PRIMARY KEY (`STUDENT ID`)
) ENGINE=myisam DEFAULT CHARSET=utf8;

SET autocommit=1;



